import React, { Component } from 'react';
import axios from 'axios';
// import Button from '@mui/material/Button';

class User extends Component {
    state = {
        users: [
            {
                // address: "",
                // birthday: "",
                // createTime: null,
                // email: "",
                // id: 1,
                // isActive: false,
                // password: "",
                // phoneNumber: "",
                // roleId: 0,
                // updateTime: null
            }
        ]
    }

    async componentDidMount() {
        let res = await axios.get('https://provinces.open-api.vn/api/?depth=2');
        this.setState({
            users: res.data
        })
    }
    console
    render() {
        let listUser = this.state.users
        return (
            <>
                <div>
                    {
                        listUser.map((item, index) => {
                            return (
                                <div key={index}>
                                    {index+1}-{item.code}-{item.codename}-{item.name}
                                </div>
                            )
                        })
                    }
                </div>
            </>
        );
    }
}

export default User;
